import { Box } from "@mui/system";
import { Toolbar } from "@mui/material";
import { ServicesTable } from "./Servicestable";
import { ServiceData } from "./Servicestable";
import { ServicesTableActions } from "./Servicestableactions";
import axios from 'axios';
import * as React from 'react';

export const Services=()=>{

  const [data,setData]=React.useState<ServiceData[]>([]);

  const getProductData = async () => {
      try {
        const data = await axios.get<ServiceData[]>(
          `https://my-json-server.typicode.com/sakthi-vunet/dummyjson/list`
        );
        console.log("sakthi");
        console.log(data);
        setData(data.data);
      } catch (e) {
        console.log(e);
      }
    };
  React.useEffect(() => {
      getProductData();
  }, );
  console.log("Services"+data);
  return (

    <Box
    component="main"
    sx={{ flexGrow: 1, p: 3, marginLeft: {  sm: `200px`, md: `200px`}}}>
    <Toolbar />
    {/* <ServicesTable data={data}/> */}
    <ServicesTableActions data={data}/>

    </Box>

  );
  }
